"234061":{"id":"234061","name":"Maldito Sonho de Conto de Fadas","slug":"maldito-sonho-de-conto-de-fadas","original_title":"나는 대놓고 신데렐라를 꿈꾼다","overview":"Shin Jae-rim sonha em se tornar uma Cinderela moderna, mas quando conhece o Príncipe Cha-min, não há nada de mágico. Será que Jae-rim conseguirá encontrar o amor verdadeiro com o homem dos seus sonhos?","first_air_date":"2024-05-31","episode_run_time":42,"vote_average":6.8,"number_of_seasons":1,"number_of_episodes":10,"created_by":["Baek Mi-kyung"],"production_companies":["KEYEAST","CJ ENM","Story Phoenix"],"genres":["Comédia"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/clkI3hotqtyRdJibuDzZc4coAyj.jpg","poster_path":"https://image.tmdb.org/t/p/original/1goarUWQzlnLpdPXb0SNXi7PlSI.jpg","cast":["표예진","이준영","Kim Hyun-jin","Song Ji-woo","김채은"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/eGimiVjqW3jaLJQuyXNo4hNu8x1.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/eGimiVjqW3jaLJQuyXNo4hNu8x1.jpg","air_date":"2024-05-31","episode_count":10,"overview":"N/A","vote_average":8,"episodes":{"1":{"name":"A Nova Cinderela","overview":"Shin Jaerim é uma mulher humilde. O testamento de seu pai diz: \"Mude sua vida casando-se com um homem rico\".","air_date":"2024-05-31","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/zD1rXmpH1tvxieRlZ1zppM1k5BR.jpg","vote_average":8},"2":{"name":"O Príncipe Encantado","overview":"No dia da entrevista, Jaerim discute com Moon Chamin, o dono do clube. Ela falha na entrevista, mas Chamin não consegue tirá-la da cabeça. Impressionado com sua confiança, decide chamá-la.","air_date":"2024-05-31","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/gZ2PvEE73anTNEtw2VF5eZkwpih.jpg","vote_average":0},"3":{"name":"O Cupido Atrapalhado","overview":"Jaerim e Chamin começam a gostar um do outro. Jaerim conhece Dan-a, a noiva de Chamin, e ele descobre o objetivo de Jaerim de conhecer um homem rico.","air_date":"2024-06-07","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/uL8TIP7NT87AuE3f90uCLsLCWwQ.jpg","vote_average":0},"4":{"name":"Bibidi-Bobidi-Bu","overview":"Chamin gosta de Jaerim e tenta não se apaixonar por ela. Ele decide organizar uma festa de boas-vindas para Dohong, mas Jaerim é humilhada na frente dos convidados da alta sociedade.","air_date":"2024-06-07","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/cYAmnunXuy8FEYpJd4TLgbKlGYt.jpg","vote_average":0},"5":{"name":"Efeito Borboleta Romântico","overview":"Chamin beija Jaerim na festa. Ela está se apaixonando lentamente por ele, mas ele explica que o beijo foi para fazer Dohong se interessar.","air_date":"2024-06-14","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/7pophJ4RpIWKaB344UJqMOYRp1l.jpg","vote_average":0},"6":{"name":"A Contraofensiva de Outro Príncipe","overview":"Dan-a diz a Jaerim que Chamin está apenas brincando com ela, então Jaerim decide se aproximar de Dohong e aceita o convite para o estúdio dele. Ela é sequestrada e Chamin a salva.","air_date":"2024-06-14","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/vvGxcxKXuWTCoBVagHWvHApLRXt.jpg","vote_average":0},"7":{"name":"Se Você Não Disser, Ninguém Sabe","overview":"Há um mal-entendido entre Jaerim e sua família adotiva. Ela decide sair, mas não tem para onde ir. Chamin a deixa ficar em sua casa, e eles sentem uma tensão sutil entre eles.","air_date":"2024-06-21","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/2F71Yg2SDdL3ZxdXDaOg0nOrXSX.jpg","vote_average":0},"8":{"name":"Uma Reconciliação Há Muito Esperada","overview":"Dohong convida Jaerim para sair e Chamin briga com ele. Jaerim não consegue entender o comportamento de Chamin. Uma mulher misteriosa aparece no clube e Jaerim descobre como Chamin se machucou.","air_date":"2024-06-21","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/lCh58qtMt86tRJwrStMLrBynb2q.jpg","vote_average":0},"9":{"name":"Você Não Sabe o Que Há na Caverna Mágica","overview":"Chamin decide convidar Jaerim para sair, mas Dan-a descobre e ameaça assediar Jaerim. Jaerim fica chateada com a mudança repentina de Chamin e tenta sondar seus sentimentos, mas ele a machuca.","air_date":"2024-06-28","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/av4NRwxeg2EEIBxKXbm83cGUwoP.jpg","vote_average":0},"10":{"name":"Para Mim Mesma, Não o Príncipe Encantado","overview":"Jaerim lembra de sua infância através de uma pintura e percebe por que perdeu seus sonhos e confiança, e que ela mesma é seu próprio Príncipe Encantado. Ela decide ir atrás do que realmente quer.","air_date":"2024-06-28","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/d5CtyaT9DbuT0qcog3KmAjcrxgr.jpg","vote_average":0}}}}},
