"209275":{"id":"209275","name":"Posso Ajudar?","slug":"posso-ajudar","original_title":"May I Help You?","overview":"Ele conta a história do mordomo Kim, que faz recados que começam a um custo de 100 won por trabalho, e do diretor funerário Baek Dong Joo, que concede os desejos dos mortos, enquanto eles operam um negócio de recados chamado Ildangbaek (que significa um pessoa fazendo o trabalho de 100, e neste caso específico, também referindo-se ao fato de que uma tarefa custa 100 won).","first_air_date":"2022-10-19","episode_run_time":70,"vote_average":7.9,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Lee Seon-Hye"],"production_companies":["iWill Media"],"genres":["Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/wDjoR40ues797wYVeJYB1Vx5pUC.jpg","poster_path":"https://image.tmdb.org/t/p/original/qOMiUV7qWwp2gFqDvARaKt4ZY8u.jpg","cast":["이혜리","이준영","송덕호","한동희","태인호"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/qOMiUV7qWwp2gFqDvARaKt4ZY8u.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qOMiUV7qWwp2gFqDvARaKt4ZY8u.jpg","air_date":"2022-10-19","episode_count":16,"overview":"N/A","vote_average":6.1,"episodes":{"1":{"name":"Fazemos de tudo","overview":"Baek Dong-joo, uma agente funerária, conhece Kim Jib-sa, um prestador de serviços da vizinhança. Dong-joo chuta a canela dele e desaparece de repente depois de pedir um serviço. Que mulher é essa?","air_date":"2022-10-19","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/n9x6Bd3mzGHNVaY488qGA1lTLqO.jpg","vote_average":6},"2":{"name":"Uma mulher estranha","overview":"Dong-joo e Jib-sa se reencontram num funeral. Jib-sa tenta fugir, mas Dong-joo o impede. Não há sinal de trégua entre eles.","air_date":"2022-10-20","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/Kk2eI5jPXkZlwVVzslHaIB9grM.jpg","vote_average":7},"3":{"name":"Vou te contar um segredo","overview":"Por que você está no armário? A Serviço Barato está em sérios apuros graças a Dong-joo. Jib-sa não sabe se pode confiar nela ou impedi-la.","air_date":"2022-10-26","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/x5Qsu8vGAPwMdUad5aEUucAtSWB.jpg","vote_average":7},"4":{"name":"O rapaz que eu já conhecia","overview":"Jib-sa interpreta mal Dong-joo depois de encontrar algo inesperado no necrotério. Enquanto isso, Dong-joo faz todo o possível para realizar o desejo da falecida.","air_date":"2022-10-27","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/4vl6CaVkzrP6I1K1lOu8YNtJDZc.jpg","vote_average":7},"5":{"name":"Mal-entendido e preconceito","overview":"Uma coisa atrás da outra acontece a Dong-joo quando ela se encontra com os clientes mortos. Sobrecarregada, ela é surpreendida por Jib-sa. No meio de tudo isso, Tae-hee pensa no que Dong-joo disse.","air_date":"2022-11-09","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/uG22GC4PyYTZ9A5i8Tce3C7eNc7.jpg","vote_average":5},"6":{"name":"Métodos de consolação","overview":"\"Você deve ter se sentido sozinha.\" Isso foi o que Tae-Hee disse depois que Dong-joo contou o que acontecia com ela. Os dois compartilham um segredo e se aproximam.","air_date":"2022-11-10","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/qO6CFWHF88vlGrXHzDri8fbvAVA.jpg","vote_average":6},"7":{"name":"Ela apareceu","overview":"Uma garota pareceu diante de Dong-joo e Tae-hee. Seu nome é Chung-ha e ela parece ter uma longa história com Tae-hee. Espere... é o primeiro amor dele?","air_date":"2022-11-16","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/dQkW6kxPqrctQnzbIkichMgZXUJ.jpg","vote_average":6},"8":{"name":"A promessa quebrada","overview":"Parece que não é só o primeiro amor. Tae-hee recorda o dia terrível dois anos antes, quando se encontrou com Chung-ha, e Dong-joo tem muito em mente pelos dois.","air_date":"2022-11-17","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/g4xkSK1zXFqQA4wnoVGituEwEkx.jpg","vote_average":6},"9":{"name":"A carta que não posso enviar","overview":"Por que quero compartilhar tudo com Dong-joo? Tae-hee conta a Dong-joo histórias que guarda no fundo do coração. Mas ainda existe algo sem solução entre eles.","air_date":"2022-11-30","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/9LasFz8Ionnvf7hteyjDprLdh2B.jpg","vote_average":7},"10":{"name":"Conheço suas mentiras","overview":"Depois da confissão de Dong-joo, Tae-hee, Chung-ha e Dong-joo encaram um novo capítulo de sua relação. Enquanto isso, alguém novo visita a Serviço Barato. Desta vez, Dong-joo vai trabalhar com seu novo cliente.","air_date":"2022-12-01","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/kgrJC62EbP5ZewQLXV0pEd3vE4R.jpg","vote_average":5},"11":{"name":"Quando o outono começa","overview":"Os dois finalmente estão num bom momento, com a chegada do outono. Espere... Quem faleceu? O nome da anfitriã parece muito familiar. Tae-hee, preciso te dizer uma coisa.","air_date":"2022-12-07","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/lXTTOq6Lov6HTPll9iI11yeNHEI.jpg","vote_average":6},"12":{"name":"Para confrontar você","overview":"O menino era irmão de Tae-hee? Dong-joo e Hae-na se dão conta de quem era Joon-ho. Agora enfrentam um dilema.","air_date":"2022-12-08","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/fuaKrYHNPDEZ9oZryvZWFhOsoIf.jpg","vote_average":6},"13":{"name":"Nossa maneira de encarar a verdade","overview":"Por que está aqui...? Seo Young-chul é seu irmão? Hae-an conta a Tae-hee o que aconteceu naquele dia. \"Para ser sincero, naquele dia...\"","air_date":"2022-12-14","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/mU9g1QZMX6iACPMtrF5dqVWvuV7.jpg","vote_average":7},"14":{"name":"Você não tem defeitos","overview":"Dong-joo está confusa depois de encontrar Young-chul na sala de preparo. Ela hesita para contar a Tae-hee, mas, ao que parece, encontra uma pista que a alivia.","air_date":"2022-12-15","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/6L69Cz64nPs0bpadJdf5wNNjVWe.jpg","vote_average":5},"15":{"name":"Últimas palavras de adeus","overview":"Dong-joo se mete em problemas com Hae-an. Tae-hee chega depressa, ansioso. Depois disso, tudo muda na Serviço Barato.","air_date":"2022-12-21","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/pE3buM1TFNBiuUSYHZmVrf7uQoe.jpg","vote_average":6},"16":{"name":"Posso ajudar?","overview":"Por que um mal pressentimento nunca está errado? Dong-ju corre até Dal-sik. \"Por favor, papai, não vá embora...\" As lágrimas de Dong-joo não param.","air_date":"2022-12-22","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/79MeGk18pOAXn8o1bogt7z4DZmt.jpg","vote_average":6}}}}},
